const New = () => {
  const materials = {
    lea: "leather",
    cot: "cottone",
  };
  return (
    <div>
      <label>Select Material</label>
      <select id="mySelect" size="4">
          {materials.map((mat) =>{
              <option>{mat.cot}</option>
          })}
      </select>
    </div>
  );
};

export default New;
